(46, 44, 'simple', NULL, NULL, NULL, 23, 'Silver', NULL, NULL, NULL, NULL, '29.9900', NULL, NULL, NULL, '2007-08-28 12:23:34', NULL, NULL, '', 'Olympus continues to innovate with the launch of the Stylus 750 digital camera, a technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom that tucks away into a streamlined metal, all-weather body design. The camera is distinguished by a number of premium features, including:\r\n\r\n    * An advanced combination of the mechanical CCD-shift Image Stabilization and Digital Image Stabilization work together to ensure the clearest pictures possible in any situation;\r\n    * A 5x optical zoom lens with a newly developed lens element to maintain a small compact size;\r\n    * A 2.5-inch LCD and Bright Capture Technology dramatically improve composition, capture and review of images in low-light situations;\r\n    * Olympus'' exclusive TruePic Turbo Image Processing engine is coupled with a 7.1-megapixel image sensor to produce crisp, high-quality p', '3.8 x 2.1 x 1 inches', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 0, '/o/l/olympus-stylus-750-7-1mp-digital-camera-2.jpg', NULL, '<ul>\r\n<ul class="disc">\r\n\r\n<li>7.1-megapixel CCD captures enough detail for photo-quality 15 x 20-inch prints<br></li>\r\n<li>5x image-stabilized optical zoom; 2.5-inch LCD display<br></li>\r\n<li>Compact, all-weather body measures 3.8 x 2.1 x 0.96 inches<br></li>\r\n<li>Bright Capture technology; 27 selectable shooting modes; built-in Help guide<br></li>\r\n<li>Stores images on xD Picture Cards; powered by Li-Ion battery (battery and charger included)</li>\r\n</ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 91, '7', NULL, 'Olympus Stylus 750 7.1MP Digital Camera with Digital Image Stabilized 5x Optical Zoom and CCD Shift Stabilization (Silver)', 'Olympus, stylus, 750, 7MP, digital, camera, zoom', 'Olympus Stylus 750 7.1MP Digital Camera with Digital Image Stabilized 5x Optical Zoom and CCD Shift Stabilization (Silver)', '161.9400', '750', NULL, NULL, NULL, ' Olympus Stylus 750 7.1MP Digital Camera', NULL, NULL, NULL, '161.9400', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom.', '750', NULL, '/o/l/olympus-stylus-750-7-1mp-digital-camera-2.jpg', NULL, NULL, NULL, NULL, 2, '/o/l/olympus-stylus-750-7-1mp-digital-camera-2.jpg', NULL, '2008-08-08 13:57:57', 'olympus-stylus-750-7-1mp-digital-camera', 'olympus-stylus-750-7-1mp-digital-camera.html', 4, '2.0000', NULL),
