INSERT INTO `review_detail` (`detail_id`, `review_id`, `store_id`, `title`, `detail`, `nickname`, `customer_id`) VALUES
(1, 1, 1, 'I love this shirt!', 'This shirts if really great. Especially with the spinal diagram, finally I can see myself for who I really am! ', 'Sandra Doe', 1),
(2, 2, 1, 'I feel strange holding a television to my head', 'I feel strange holding a television to my head.  This product should come with free suspenders', 'Starbuck', 1),
(3, 3, 1, 'Cute, but see through', 'Cute design, but material is too thin.', 'Natashenka', 1),
(4, 4, 1, 'chics dig ribs', 'Ever since buying this shirt chics cant take their hands off me. I don''t know what it is it must be sprayed with axe - the seductive body spray for men. I''m the last one to believe commercials but I tell you you won''t regret buying this shirt. I ordered it n every color.', 'udini', 1),
(5, 5, 1, 'Not an i-phone', 'cest ci nest pas une i-phone.', 'Udini', 1),
(6, 6, 1, 'It''s a pitty they don''t have large sizes', 'You wont believe it, my show size is 13 so it''s impossible for me to get a new pa', 'Seba''s', 1),
(7, 7, 1, 'Great all around phone', 'Hello all. Just received my phone a few days ago, was super fast shipping using the 2 day shipping option (which by the way is free!! So make sure you select that, as the discount is only shown when you are about to place the final purchase). Luckily I ordered my phone right before the phone was about in low stock.\r\nPHONE: So can''t really complain about much of anything. Phone has really intuitive interface, very easy to navigate as the arrow keys all function as shortcuts (to calls, file folders, aim, etc..). The walkman button is very convenient as it leads right to the music player. ', 'John Johnson', 1),
(8, 8, 1, 'Awesome Phone', 'The phone is awesome. Fully Loaded & sounds really great, camera is also good.2MP.\r\nExcellent!!! ', 'Panda', 1),
(9, 9, 1, ' Ultimate Cell Phone', 'Wow....What a great cell phone. I really like.....no no.....LOVE this Phone. The Functions and usability of this one are too cool. The MP3 Player palys nice with good user interface. The 2.0 MP Camera is very good, I have stopped taking my Digi Cam to my trips. I never have anytype of problem during the phone call. So considering the +ve points, I truly recommend it to any one.', 'Ananda', 1),
(10, 10, 1, 'Worth the upgrade!!!', 'I''ve had this phone now for 2 weeks and it has met all of my expectations and exceeded them even. I upgraded from the 8125 and just about everything is a huge improvement!\r\nThe 3G(UMTS) is very impressive with it''s speed. I even use this phone as a modem on my home pc and it''s nearly identical in speed as DSL when surfing the net or downloading file/music etc.\r\nCamera is very impressive with clear resolutions for a camera phone with the 2MP.\r\nI also use a bluetooth headset 2.0 with this and mine works wonderfully with sony erriccson; it''s quite intuitive and picks up the signal instantly. The ''blackberry'' scroll wheel is a huge plus on this phone and I find myself using this feature more than any other buttons. ', 'Armstrong', 1),
(11, 11, 1, 'Sweet!', 'What I love:\r\n============\r\n- Form factor: It is beautiful, it is cute and catchy! It turns heads. Enough said.\r\n- Size: Size is one of the strongest points considering all it does. It neatly slips into a shirt pocket or sits well on the belt.\r\n- Keys: Could be a bit small but I could use it pretty easily though my fingers are bordering on ''butterfingers''.\r\n- Trackball: Awesome! Just don''t press it too hard while using it. Just ''roll-it''!. It is great while you have to move around the screen from control to control\r\n- Voice-dialing: Has worked for me very well the 10 or so times I have tried in my van on the road and off. You have to first choose the voice dialing option from the list of icons on the main menu. I read you can ', 'Ashwini', 1),
(12, 12, 1, 'Fouch', 'I wouldn''t normally write a review, but everyone is giving this phone a bad rap.. I think people that buy into those reviews are getting cheated out of an excellent phone. I''ve know several people with Razors that ALL like this much much better. The battery life is absolutely fine, and my phone is on vibrate all day. Maybe other reviewers are on the phone constantly on full blast playing mp3s and shooting video.. I don''t get it. I''ve had this phone the better part of a year and never ran out of charge during the day. I plug it in at night. I work as an architect and am on the phone all day long and beat the living hell out of it.. which is another huge plus about this phone. It has a *sturdy* metal housing.. not thin toy crap a la razors or plastic like most phones. I don''t do a lot of bluetooth, computer syncing, etc, just use the phone in a fairly conventional way, with regular camera use, and for that it is *easily* far and away the best phone I''ve ever owned.', 'solid phone', 1),
(13, 13, 1, ' A crippled cell phone', '1, you can not synchronize the phonebook with your PC in a convenient way. I had to code a program to generate single vcard files and send them over bluetooth ONE BY ONE. There seems to be no way to do it without bluetooth.\r\n\r\n2, you can not apply mp3 files as ringtones. However you can download mp3/aac ringtones from sprint (for a fee). Oh the original ringtones that came with the phone? They are just awful.\r\n\r\n', 'bessel', 1),
(14, 14, 1, 'MJS', 'Yeah it looks cool, but it''s got terrible sound quality, even with an ear-piece. Additionally, they''ve crammed a lot of stuff into the menus that would probably be desirable to some people, but if you don''t want it, it''s just more junk to have to navigate through.', 'Looks can be deceiving', 1),
(15, 15, 1, 'Great phone - unless you are outside or in the car', 'I only needed a basic phone - no MP3, camera, or FM radio. This phone delivered with great reception, good sound quality, great battery life, and a very small size. Inside a building it works great. Why the low score? The tinted plastic over the display makes it impossible to see the display outdoors and in the car. If the sun is out, forget it! I even managed to figure out how to remove all of the wallpaper backgrounds and to maximize the contrast. Still, don''t plan to use this outdoors. Nokia should recall this product to replace the tinted cover. Update: Yesterday this phone took was accidently dropped onto a very hard ceramic tile floor and it still works perfectly! A similar drop ended the life of my digital camera a few months ago. So, if I were to rate this cell phone now I would give it 3 stars, maybe even 4 stars. I like reliable, sturdy stuff and this cell seems to be unusually well made.', 'Sheridan', 1),
(16, 16, 1, ' The Fastest Mac Notebook Ever', 'It''s the most stunning idea, isn''t it? This top of the line MacBook Pro is the fastest Mac Notebook ever, and probably one of the fastest Macs period.\r\n\r\nWhen Steve Jobs announced the new Macs, with Intel Core Duo processors I was almost certain I wanted to buy one. Why? Macs are well known for ease of use and capabilities, but they have managed all that for years, with processors that are not always top-notch. That all changed in January 2006.\r\n\r\n', 'Stephen', 1),
(17, 17, 1, 'It''s worked phenominally for me so far...', 'Fortunately, the computer worked and worked well from the start for me. The performance is phenomenal, the craftsmanship and style are only slightly short of amazing. (sturdy and stylish, but heavy and heats up quickly.) I hope I never have to deal with customer service but the product performs. The worse thing is that if you have it set to use full power all of the time you get maybe an hour and a half of battery time. Still like my PowerBook better though.', 'Next', 1),
(18, 18, 1, ' Not happy at all', 'I purchased the Red Ferrari Laptop and had nothing but problems form the start. I was supposed to get a free matching mouse, when I received the mouse it looked two years old. When I got laptop working the wrist rest pad right next to the mouse pad was heating up to an uncomfortable level. When I notified PCmode, the supplier of the laptop, they agreed to replace it with another laptop. When I asked if it had the same problems, they told me it headed up as all laptops heat up. The agreed to replace the laptop with another laptop but with a 50% lesser value than the one I purchased.\r\n\r\nI will never buy from these people again... ', 'Cappello', 1),
(19, 19, 1, 'Vision of Vaio...', 'If you''re buying this laptop, it''s undoubtedly partially for the design, style and lightweight features of the TX series. You can get cheaper, better performing options at about the same weight, but it won''t have the "wow" factor of this TXN27N. That being said let''s get right into the pros and cons.\r\n\r\nAs a side note, if you''re wondering about differences between the 25,27, 29 TX models, it''s pretty straightforward. The 25 has 1GB RAM and 80GB hard drive, the 27 has 2GB RAM, 100 GB hard drive, the 29 is the same as the 27 except it comes with a carrying case and the exterior has a sleek special shiny coating. IMO, the 27N is the best value among the 3 when you look at the price points.\r\n\r\n', 'Chen', 1),
(20, 20, 1, 'Sleek compact design for business travelers on the go.', 'I waited to get this notebook loaded with Vista. I have mixed feelings. The notebook hardware design is quite sleek and handsome. I am not so impressed with Vista running on this machine though. It just feels that Vista is a resource hog and is constantly running the CPU at 100% which causes the fan to run endlessly. I think the issue is that Sony used the same hardware specs as the previous TX series just to get a Vista version out quickly, but it really is not equipped to handle the new Vista OS as well. So I was disappointed when I upgraded to this notebook thinking that it would run faster, but actually it runs slower than my previous Vaio running Win XP. Though there are some improvements with Vista over XP, Vista probably runs better on a Duo Intel chipset than the Solo that is used in this notebook. The poor notebook is contantly working overtime just to do very simple normal every day applications and it takes forever to start up or reboot. If you just base it on looks alone, then it gets a 4 start rating.', 'Steven', 1),
(21, 21, 1, 'Solid and reliable', 'At first, I wasn''t terribly impressed. I had been accustomed to working\r\nwith a Toshiba Protege M405 at home and when I purchased the Gateway for\r\nexclusive use at the office, my initial impression of the machine when\r\nI put it into action was noticeably lacking in enthusiasm or excitement.\r\n\r\nI''ve since come to appreciate this notebook for something much more\r\nimpressive that I couldn''t gauge out of the box, and that was its\r\namazing reliability and performance over time.\r\n\r\nThis machine is solid. It does not crash.\r\n\r\n', 'Mendez', 1),
(22, 22, 1, 'Love it!!! get it!!!', 'You got to have one of these they come in green', 'yochan', 1),
(23, 23, 1, 'Extremely Comfortable!!!', 'i love this T-shirt\r\nthe quality is nice\r\nand it''s very soft without tag\r\n\r\ni bought the white one\r\nit can be see through just like other custom''s review.\r\n\r\nalso i think their size small is a little bigger than other brand\r\nbut it''s not a big deal though! ', 'Robin', 1),
(24, 24, 1, 'excellent', 'The T-shirt is a very good one. its comfortable and easy to wash, doesn''t even soften the cloth when washed daily. i love it and good stuff', 'A Review', 1),
(25, 25, 1, 'Perfect Cotton Feel', 'My friend really liked the Tee shirt.he did''nt think that I would be able to get it in his size but I was able to.I really made my friends day when I told him that I was able to find the tee shirt in the size he wanted.', 'Adam', 1),
(26, 26, 1, 'Great, affordable product', 'These tee shirts are generously cut, hold their color, stand up to repeated washings and are very comfortable. In addition, they are comfortable, extremely affordable and maintain their shape. I highly recommend them.', 'Patrick', 1),
(27, 27, 1, ' Well made, affordable. . .you can''t go wrong!', 'I am very hard on my t-shirts, and therefore, I need the best quality t-shirt on the market. I''ve tried them all (except Hanes).  Durable, strong, and surprisingly flattering to those of us lugging around a spare tire, if you get my drift.', 'Mike', 1),
(28, 28, 1, 'Inexpensive and very light weight clog', 'This clog was inexpensive compared to crocs, but I found it did not fit my foot very well. It is, however, very light weight and would otherwise be comfortable. It is also not very attractive. I would not wear this one anywhere but my own yard for gardening, etc.', 'Loren', 1),
(29, 29, 1, ' Beach Clogs,', 'I received these today in the mail and am pleased with the way these feel on my feet,they are so comfortable and so easy to slide on.', 'Laurie', 1),
(30, 30, 1, 'Love the look and was comfy for heels!', 'Would give them 5 stars if not for the toe cleavage issue. Loved them enough to keep them though. Very cute!', 'Shoe Lover', 1),
