(34, 34, 1, 'Comfortable, good-looking', 'This is a sharp-looking shoe that is very comfortable for walking and provides a good alternative to the traditional, boring "golf shoe."\r\n', 'Kathryn', 1),
(35, 35, 1, 'womens golf shoes', 'These shoes are my first pair of golf shoes.I have bad feet and wear orthotics so I really wanted a pair of shoes that would feel great on my feet. These are really nice and are a great price for this brand.', 'Moqilka', 1),
(36, 36, 1, ' Great Purchase. Best value and very comfortable,', 'I purchased a pair and have been using it everyday from the past six months. The shoes are very comfortable and look very professional. Love them.', 'Arun', 1),
(37, 37, 1, 'Top leather scuffed on first wear', 'The shoes look and wear great. However, the leather is pretty weak. I think I must have kicked a table leg or something on my frist outing in them. Now the tip of my left shoe has a quarter-size scuff on it. I will have to try to cover it up by oiling it. Obviously I don''t think this pair will last long at all.', 'Lian', 1),
(38, 38, 1, ' !!!!!!', 'this is exactly what i wanted from a sweatshirt.\r\n\r\nit has a tight figure with a full sized hood\r\nand its really warm and comfortable. ', 'Sanchez', 1),
