(41, 41, 1, ' its a modern bed!', 'actually my bf and i we were looking for a king size bed..when i saw this bed it was beautiful and thats the color i like and also its a modern style....\r\n', 'Gertrude', 1),
(42, 42, 1, ' Excellent!', ' Excellent wood bed and drawer set.  Excellent value, fast shipping and a quality product. Awesome! ', 'David', 1),
(43, 43, 1, ' Another stunning winner from the bright minds at Canon', 'I spent three hours yesterday playing with the brand-new Canon Digital Rebel XT digital SLR camera, and man, was I impressed.\r\n\r\nI hadn''t been too impressed with the original Digital Rebel, except for its revolutionarily low price (for a d-SLR), because it was slow and felt slimsy. The new DR XT is quite different. Even though it''s 3 ounces lighter than the original DR -- mostly due to the use of a smaller battery; see below -- its smaller form factor actually makes it feel more solid and "real". In other word, unlike the original DR, this one feels professional, not toy-like at all.\r\n\r\n\r\n', 'Mira', 1),
(44, 44, 1, ' The best thing I''ve ever bought', 'The XT is amazing. The battery comes partly charged so you can immedietly start using the camera (thank you Canon!) I''ve already shot about 200 pictures with it and the battery hasn''t died yet.\r\n\r\n\r\n\r\n\r\n', 'Al', 1),
(45, 45, 1, 'great, comfy flip flops!', 'Very comfortable flip flops! I wear a size 10-11 and the "extra-large" was too small. Most stores don''t carry the 10 or 11 (beyond extra-large) but I was able to find them on Amazon. Don''t give up if you need a bigger size than the extra-large!', 'Erika', 1),
(46, 46, 1, 'These are the best sandals!', 'They were delivered really quickly and are just what I was expecting. The are great quality and so comfortable!', 'Jenna', 1),
(47, 47, 1, 'I love this Ottoman', 'Best Ottoman ever!!!!', 'Terry Ferguson', 1),
(48, 48, 1, 'I can''t believe they still make PC''s....', 'These Mac''s are so much better than PC''s it''s unbelievable!!!   Obviously designed for the user...  less clicks to get to everything.  amazing!!!', 'Terry Ferguson', 1),
(49, 49, 1, 'great for everyday use', 'I purchased this camera a few months ago because I like to have a camera on hand always. My DSLR and 35 mm SLR cameras are too bulky for everyday. The price and MPs were right, as well as the small size which fits into the clean pockets of any of my purses- no need to worry about lens scratch. For those who don''t carry a purse and are concerned about the lens, a very small case will do the trick. The images are clean although I''ve only printed up to 8.5 X 11 so far.', 'Stull', 1),
(50, 50, 1, 'Amazing camera value!', 'This is one of those nice cameras that''s so well done, it''s easier to talk about what the camera ISN''T, rather than what it IS! This camera is not a small, shirt pocket camera, and might be a bit bigger than a woman would wish to carry in a purse. It''s not a super-tele camera, but it does have a respectable, bit longer than average 4x optical zoom. ', 'Juan', 1),
(51, 51, 1, 'Good Camera', '    	\r\n77 of 82 people found the following review helpful:\r\nGood Camera, October 11, 2006\r\nBy 	Steve (FL) - See all my reviews\r\nGot it yesterday. In green. Actually it''s a shiney yellowish-green. Nice feel. Fits well in shirt pocket. Very light; particullarly compared to my Pentax Optio 550. Good, nice size LCD. Easy to use yet with nice availability of choices for customization. Well written manual (you can find online thru google) and onboard help menu. Photos come out fairly nice. Tried indoors in low light with several scene settings, outdoors, macro, and supermacro. Colors look true, fairly sharp without noticable artifact. Used in South Florida morning daylight outside without any trouble with LCD viewing (camera has no classic viewfinder). Have read reviews of washout in bright sun: have not tried that yet. Overall, I''m happy with the camera thus far. ', 'Jenella', 1),
(52, 52, 1, 'Great inexpensive Couch', 'I love this couch...  extremely comfortable and easy to clean\r\n', 'Toish', 1),
